import React from 'react';
import PropTypes from 'prop-types';

// Project component receives a 'project' prop
const Project = ({ project }) => {
  // Ensure 'project' is defined before rendering
  if (!project) {
    return <p>No project data available.</p>;
  }

  return (
    <section id="project" style={styles.section}>
      <div style={styles.container}>
        {/* Projects Section */}
        <div style={styles.sectionHeader}>
          <h2 style={styles.sectionTitle}>Projects</h2>
        </div>

        <div style={styles.timelineContainer}>
          <div style={styles.timelineContent}>
            {project.map((proj) => (
              <TimelineCard
                key={proj.title}
                title={proj.title}
                icon={proj.icon}
                description={proj.description}
                date={proj.date}
                additionalInfo={proj.additionalInfo}
                imageSrc={require(`../../assets/images/${proj.image}`)} // Assuming proj.image contains the image name
                animation={proj.animation}
              />
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

const TimelineCard = ({ title, icon, description, date, additionalInfo, imageSrc, animation }) => (
  <div style={styles.cardContainer}>
    <div style={styles.iconContainer}>
      <img src={imageSrc} alt={`Icon for ${title}`} style={styles.iconImage} />
    </div>
    <div style={styles.cardContent}>
      <div data-aos={animation} data-aos-duration="1200" style={styles.timelineCard}>
        <h3 style={styles.cardTitle}>
          {icon && <i className={`${icon} mr-2`}></i>} {title}
        </h3>
        <p style={styles.cardDescription}>{description}</p>
        {date && <p style={styles.cardDate}>{date}</p>}
        {additionalInfo && <p style={styles.cardAdditionalInfo}>{additionalInfo}</p>}
      </div>
    </div>
  </div>
);

TimelineCard.propTypes = {
  title: PropTypes.string.isRequired,
  icon: PropTypes.string,
  description: PropTypes.string.isRequired,
  date: PropTypes.string,
  additionalInfo: PropTypes.string,
  imageSrc: PropTypes.string.isRequired,
  animation: PropTypes.string.isRequired,
};

// CSS-in-JS Styles
const styles = {
  section: {
    padding: '4rem 2rem',
    background: 'linear-gradient(135deg, #f3e5f5, #f1f8e9)',
    borderRadius: '0.75rem',
    boxShadow: '0 4px 20px rgba(0, 0, 0, 0.1)',
  },
  container: {
    maxWidth: '1200px',
    margin: '0 auto',
    padding: '0 1rem',
  },
  sectionHeader: {
    textAlign: 'center',
    marginBottom: '3rem',
  },
  sectionTitle: {
    color: '#8e24aa',
    fontWeight: 'bold',
    fontSize: '2.75rem',
    marginBottom: '0.5rem',
    textTransform: 'uppercase',
    letterSpacing: '1.2px',
  },
  timelineContainer: {
    display: 'flex',
    flexDirection: 'column',
    gap: '2rem',
    padding: '2rem',
    backgroundColor: '#fff',
    borderRadius: '0.75rem',
    boxShadow: '0 4px 16px rgba(0, 0, 0, 0.05)',
  },
  timelineContent: {
    display: 'flex',
    flexDirection: 'column',
    gap: '2rem',
  },
  cardContainer: {
    display: 'flex',
    alignItems: 'center',
    gap: '1.5rem',
    backgroundColor: '#fce4ec',
    padding: '1.5rem',
    borderRadius: '0.75rem',
    transition: 'transform 0.3s ease',
    boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
  },
  cardContent: {
    flex: 1,
  },
  timelineCard: {
    padding: '1.25rem',
    borderRadius: '0.75rem',
    backgroundColor: '#f3e5f5',
  },
  iconContainer: {
    flexShrink: 0,
  },
  iconImage: {
    width: '70px',
    height: '70px',
    objectFit: 'cover',
    borderRadius: '50%',
  },
  cardTitle: {
    fontWeight: 'bold',
    fontSize: '1.6rem',
    color: '#6a1b9a',
  },
  cardDescription: {
    fontSize: '1rem',
    color: '#37474f',
    marginTop: '0.5rem',
  },
  cardDate: {
    fontStyle: 'italic',
    color: '#8d6e63',
    marginTop: '0.25rem',
  },
  cardAdditionalInfo: {
    fontSize: '0.9rem',
    color: '#6d4c41',
    marginTop: '0.25rem',
  },
};

Project.propTypes = {
  project: PropTypes.arrayOf(
    PropTypes.shape({
      title: PropTypes.string.isRequired,
      icon: PropTypes.string,
      description: PropTypes.string.isRequired,
      date: PropTypes.string,
      additionalInfo: PropTypes.string,
      image: PropTypes.string.isRequired, // Adjusted to reflect image name
      animation: PropTypes.string.isRequired,
    })
  ).isRequired,
};

export default Project;
